import {BrowserRouter,Route,Routes}from 'react-router-dom'
import { Link } from "react-router-dom"
//stranice i komponente

import Home from './pages/Home';
import Navnar from './components/navbar';
import Login from './pages/Login';
import Signup from './pages/Signup';


function App() {
  return (
    <div className="App"
    style={{  height:1000 ,
  backgroundImage: "url(" + "https://png.pngtree.com/thumb_back/fh260/background/20200714/pngtree-modern-double-color-futuristic-neon-background-image_351866.jpg " + ")",
  backgroundPosition: 'center',
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat'
}}
    >
      <BrowserRouter>




      <div className='pages'>

      <Link to="/sirovine">
<h1> Sirovine page</h1>
            </Link>
            <div>
              <Link to="/login">Login</Link>
              <Link to="/register">Register</Link>
            </div>

        <Routes>
          <Route
          path='/login'
          element={<Login/>}
            />

          <Route
          path='/register'
          element={<Signup/>}
            />


        </Routes>

      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
